": "Babu's is a dynamic company that stands for simplicity, heartiness and enjoyment - right in the vibrant heart of Zurich.", "staticContent": "With two coffee houses in District 1, a bakery in District 3 and our production facility in Zurich Binz, we provide our guests with freshly baked delicacies, home-made dishes and high-quality coffee every day. Whether for breakfast, brunch, lunch or a relaxed coffee break - we create enjoyable moments in a cozy atmosphere and invite you to linger."}, {"type": "text", "style": "standard", "title": "Introduction", "staticContent": "For our bright and loft-like production in Binz, we are looking for a committed assistant/cleaner who lives our philosophy and supports the company with passion.\\nAre you motivated to become part of our team?"}, {"type": "key_value", "style": "standard", "title": "ECKDATA"}, {"type": "list", "style": "bullet", "title": "YOUR TASKS", "dataKey": "responsibilities"}, {"type": "list", "style": "bullet", "title": "WHAT YOU BRING", "dataKey": "requirements"}, {"type": "list", "style": "bullet", "title": "WHAT WE OFFER"}, {"type": "text", "style": "standard", "title": "Application Instructions", "staticContent": "We look forward to receiving your application with the usual documents by e-mail to info@babus.ch."}]}
