: "standard", "title": "Application Instructions", "staticContent": "We look forward to receiving your application with the usual documents by e-mail to info@babus.ch."}]}
a44a3e8a-a65b-4b8c-8c6f-349ea6c04913	da40e9c0-7866-4dd0-b4c7-f9bfd4202c24	Assistant Cook	Kitchen	Löwenstrasse 1, 8001 Zurich, Switzerland	Full time	Babu's is a dynamic company located in Zurich with coffee houses, a bakery, and a production facility. They provide freshly baked delicacies, home-made dishes, and high-quality coffee daily. The Assistant Cook works full time at Löwenstrasse 1, 8001 Zurich, with various shifts Monday to Sunday. The role includes food preparation, hygiene maintenance, mise en place, cleaning, and dishwasher support. Candidates should have at least 2 years kitchen experience, good German and/or English skills, social competence, passion, willingness to learn, and be a team player. Babu's offers a modern workplace, a young dynamic team, an open and trusting culture, opportunities for internal promotion, regulated working hours, performance-based salary, and discounts. Applications are accepted by email to info@babus.ch.	{"title": "Assistant Cook", "summary": "Babu's is seeking an Assistant Cook to join their kitchen team in Zurich. The role involves food preparation, maintaining hygiene standards, mise en place, cleaning tasks, and supporting dishwashing as needed.", "location": "Löwenstrasse 1, 8001 Zurich, Switzerland", "apply_url": "https://babus.ch/pages/hilfskoch-1001/3", "clean_text": "Babu's is a dynamic company located in Zurich with coffee houses, a bakery, and a production facility. They provide freshly baked delicacies, home-made dishes, and high-quality coffee daily. The Assistant Cook works full time at Löwenstrasse 1, 8001 Zurich, with various shifts Monday to Sunday. The role includes food preparation, hygiene maintenance, mise en place, cleaning, and dishwasher support. Candidates should have at least 2 years kitchen experience, good German and/or English skills, social competence, passion, willingness to learn, and be a team player. Babu's offers a modern workplace, a young dynamic team, an open and trusting culture, opport